import React, {Component} from 'react'
import { Card, Button } from 'semantic-ui-react'


export default class EnrollmentList extends Component {
	constructor(props) {
		super(props)
	}

	deleteEnrollment = () => {
		console.log('deleteEnrollment');
	}

	displayEnrollment = () => {
		this.props.enrollments.map(enrollment => {
		return (
			<Card key={enrollment.id} color={'purple'}>
				<Card.Content textAlign={'center'}>
					<Card.Header>
						{enrollment.enrolled_course.course_name}
					</Card.Header>

					<Button className='negative mini ui button' onClick={this.deleteEnrollment}>
						Cancell Enrollment
					</Button>
					<Button>
						view
					</Button>
				</Card.Content>
			</Card>
		)
	})

	return (
		<Card.Group centered={true}>
		{enrollment}
		</Card.Group>
	)
}
}
